commit_message:
.travis.yml: travis_retry .travis/install.sh so we will retry if an install fails because of a networking blip, like
for instance this one with setuptools:

https://travis-ci.org/pypa/pip/jobs/58362989

Constant-fold unpack in prepare_files. We had this structure widely spread out:
unpack = True
if link:
  if thing:
    raise
  else:
    stuff
else:
  unpack = False
if unpack:
  stuff2

First transform was:
if link:
  if thing:
    raise
  stuff
  unpack = True
else:
  unpack = False
if unpack:
  stuff2

Which made it obvious that we didn't need unpack:
if link:
  if thing:
    raise
  stuff
  stuff2
